import React from "react";
import Footer from "../../Layouts/Footer";
import Dashboard from "./Dashboard";

const Index = () => {
    return(
        <>
            <div className='wrapper'>
                <Header/>
                <div className="main-panel">
                    <div className="container">
                        <Dashboard />
                    </div>
                </div>
                <Footer/>
            </div>

        </>
    )
}

export default Index;
